    body:
      'Caro coder!\r\n\r\nEste projeto é uma cópia da página inicial do facebook, nele será aplicado meus conhecimentos sobre html, css e javascript. Leia com atenção todos os pontos e curta o resultado final. Ficará extremamente bonito!\r\n\r\nRequisito Principais:\r\n- [x] Crie uma barra azul na parte superior da página.\r\n- [x] Posicione o logotipo do Facebook no canto esquerdo na barra superior.\r\n- [x] Adicione um formulário de autenticação no canto direito da barra superior.\r\n- [x] Crie uma classe no CSS.\r\n- [x] Adicione um subcontainer para agrupar o rótulo e campo "E-mail ou telefone" dentro do formulário criado na etapa 3.\r\n- [x] Adicione um subcontainer para agrupar o rótulo e campo "Senha" dentro do formulário criado na etapa 3.\r\n- [x] Adicione um subcontainer com o botão "Entrar" dentro do formulário criado na etapa 3.\r\n- [x] Crie um container abaixo da barra azul para agrupar o conteúdo principal da página.\r\n- [x] Crie um subcontainer para colocar o conteúdo do lado esquerdo.\r\n- [x] Crie um subcontainer para colocar o conteúdo do lado direito.\r\n- [x] Crie um campo de entrada de texto para o nome do usuário dentro do formulário criado no requisito 10.\r\n- [x] Crie um campo de entrada de texto para o sobrenome do usuário dentro do formulário criado no requisito 10.\r\n- [x] Crie um campo de entrada de texto para o celular ou email do usuário dentro do formulário criado no requisito 10.\r\n- [x] Crie um campo de entrada para senha do usuário dentro do formulário criado no requisito 10.\r\n- [x] Crie um campo de entrada para data de nascimento do usuário dentro do formulário criado no requisito 10.\r\n- [x] Crie um campo de entrada para gênero do usuário dentro do formulário criado no requisito 10.\r\n- [x] Crie um botão para finalizar o cadastro dentro do formulário criado no requisito 10.\r\n- [ ] Validar se todos os campos foram preenchidos ao clicar no botão Cadastre-se.\r\n- [x] Adicione um novo campo de texto no formulário se a pessoa usuária selecionar a opção Personalizado no campo Gênero.\r\n- [ ] Substitua o conteúdo do container com a classe right-content se o formulário estiver completamente preenchido e validado.\r\n\r\nRequisito Bônus:\r\n- [ ] Realize o desenvolvimento da versão mobile do Facebook.',
