    body:
      "#### What's this PR do?\r\nThis changes from a facebookID to use the facebook username for example https://facebook.com/brianteeman\r\n\r\nI wasn't sure what the projects policy on backwards compatibility was so I renamed the database column. This means that in an upgrade script you can either rename the column AND change its type or add a new column. I have NOT created any update scripts.\r\n\r\nThe field is now usable - woohoo\r\n\r\nAs a bonus I also changed the way the facebook, twitter and linkedin links are displayed. (yeah I know - I should have done that in a separate PR) Now instead of it being Facebook: Facebook etc it is displayed as Facebook: username see screenshots\r\n\r\n#### Screenshots (if appropriate)\r\n**Before**\r\n![image](https://user-images.githubusercontent.com/1296369/109307982-576a8600-7839-11eb-9834-117b2623ef9e.png)\r\n\r\n**After**\r\n![image](https://user-images.githubusercontent.com/1296369/109307885-34d86d00-7839-11eb-8651-c5e3a0e6eb0e.png)\r\n\r\n#### What Issues does it Close?\r\n\r\nCloses #5661 #3661 \r\n\r\n#### What are the relevant tickets?\r\n\r\n#### Any background context you want to provide?\r\n\r\n#### Where should the reviewer start?\r\n\r\n#### How should this be manually tested?\r\n\r\n#### How should the automated tests treat this?\r\n\r\n#### Questions:\r\n- Is there a related website / article to substantiate / explain this change?\r\n  -  [ ] Yes - Link:\r\n  -  [ ] No\r\n\r\n- Does the development wiki need an update?\r\n  -  [ ] Yes - Link:\r\n  -  [ ] No\r\n\r\n- Does the user documentation wiki need an update?\r\n  -  [ ] Yes - Link:\r\n  -  [x] No\r\n\r\n- Does this add new dependencies?\r\n  -  [ ] Yes\r\n  -  [x] No\r\n\r\n- Does this need to add new data to the demo database\r\n  -  [x] Yes\r\n  -  [ ] No\r\n\r\n",
